import React from 'react';
import logo from './media/Roomie.png';
import './style.css';

function LoginPage() {
    return (
        <>
        <img src={logo} className="logos" alt="Logo" />
        <label>enter email:</label>
        <input type="text" />
        <label>enter password:</label>
        <input type="password" />
        </>
    )
}

export default LoginPage
